isAcceptableNode(node: Node): boolean {

    const nodeType = node.nodeType;

    const nodeFilterType =

        nodeType === Node.ELEMENT_NODE

            ? SHOW_ELEMENT

            : nodeType === Node.TEXT_NODE

              ? SHOW_TEXT

              : 0;

    return !!(nodeFilterType & this.nodeType) && this.filter(node as T);

}
